import React, { useState } from 'react';
import translations from './translations'; 




export default function Iban() {
  
  const banks = [
    { code: '55', name: 'Banque Saudi Fransi', nameEn: 'Banque Saudi Fransi', nameAr: 'البنك السعودي الفرنسي', img: './img/55.png' },
    { code: '80', name: 'Alrajhi Bank', nameEn: 'Alrajhi Bank', nameAr: 'بنك الراجحي', img: './img/80.png' },
    // Add other banks here...
  ];
  
  const IBAN_LENGTH = 24;
  const IBAN_PREFIX = 'SA';
    const [language, setLanguage] = useState('en');
    const [iban, setIban] = useState('');
    const [message, setMessage] = useState('');
    const [error, setError] = useState('');
  
    const validateIBAN = (iban) => {
      if (!iban) return translations[language].ibanLengthError;
  
      iban = iban.trim();
  
      if (iban.length !== IBAN_LENGTH) return translations[language].ibanLengthError;
      if (!iban.startsWith(IBAN_PREFIX)) return translations[language].ibanStartError;
  
      return '';
    };
  
    const getBankByIban = (event) => {
      event.preventDefault();
      const errorMessage = validateIBAN(iban);
      if (errorMessage) {
        setError(errorMessage);
        setMessage('');
      } else {
        const bankCode = iban.substring(4, 6); // Extract the bank code correctly
        const bank = banks.find((b) => b.code === bankCode);
        if (bank) {
          setMessage(
            <div>
              <p className='fs-4'>{translations[language].ibanCorrect} {language === 'ar' ? bank.nameAr : bank.nameEn}</p>
              <img src={bank.img} alt={language === 'ar' ? bank.nameAr : bank.nameEn} style={{ width: '250px', height: 'auto' }} />
            </div>
          );
          setError('');
        } else {
          setError(translations[language].bankNotFound);
          setMessage('');
        }
      }
    };
  
    const handleInputChange = (e) => {
      const inputValue = e.target.value.replace(/\s/g, '');
      setIban(inputValue);
      if (inputValue.length <= IBAN_LENGTH) {
        setError('');
      } else {
        setError(translations[language].ibanLengthError);
      }
    };
  

  return (
<>
    <div className="container-fluid">
      <select onChange={(e) => setLanguage(e.target.value)} className="form-select">
        <option value="en">English</option>
        <option value="ar">Arabic</option>
      </select>
    </div>
    <div className="d-flex justify-content-center align-items-center min-vh-100">
      <div className="container mt-5 p-1">
        <div className="row">
          <div className="col-md-6 offset-md-3">
            <div className="card shadow-lg p-3 mb-5 bg-body rounded">
              <div className="card-body">
                <form onSubmit={getBankByIban}>
                  <div className="form-group">
                    <label htmlFor="iban" className="badge bg-success fs-6 mb-2">
                      {translations[language].ibanLabel}
                    </label>
                    {error && <div className="alert alert-danger mt-2">{error}</div>}
                    <input
                      type="text"
                      name="iban"
                      id="iban"
                      className={`form-control border-2 ${error ? 'border-danger' : 'border-secondary'}`}
                      value={iban}
                      onChange={handleInputChange}
                      placeholder={translations[language].ibanPlaceholder}
                    />
                  </div>
                  <div className="form-group mt-3">
                    <button type="submit" className="btn btn-primary">
                      {translations[language].submitButton}
                    </button>
                    <button
                      type="reset"
                      className="btn btn-danger mx-3"
                      onClick={() => {
                        setIban('');
                        setError('');
                        setMessage('');
                      }}
                    >
                      {translations[language].resetButton}
                    </button>
                  </div>
                </form>
                <div id="result" className="mt-3">
                  {message}
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  </>
);
}
